import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles(theme => ({
    head: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

const StyledTableRow = withStyles(theme => ({
    root: {
        '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.background.default,
        },
    },
}))(TableRow);

function createData(sNo, photo, name, price, productId, status, action) {
    return { sNo, photo, name, price, productId, status, action};
}

const rows = [
    createData(1, 159, 6.0, 24, 4.0, 34, 45),
    createData(2, 237, 9.0, 37, 4.3, 45, 67),
    createData(3, 262, 16.0, 24, 6.0, 42, 12),
    createData(4, 305, 3.7, 67, 4.3, 34, 45),
    createData(5, 356, 16.0, 49, 3.9, 56, 67),
];

const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        marginTop: theme.spacing(3),
        overflowX: 'auto',
    },
    table: {
        minWidth: 700,
    },
    tableHead:{
        backgroundColor: "#fff2f2"
    }
}));

export default function CustomizedTables() {
    const classes = useStyles();

    return (
        <Paper className={classes.root}>
        <Table className={classes.table}>
            <TableHead classes = {classes.tableHead}>
            <TableRow>
                <StyledTableCell>S.No</StyledTableCell>
                <StyledTableCell align="right">Photo</StyledTableCell>
                <StyledTableCell align="right">Name</StyledTableCell>
                <StyledTableCell align="right">Price&nbsp;(g)</StyledTableCell>
                <StyledTableCell align="right">Product Id</StyledTableCell>
                <StyledTableCell align="right">Status</StyledTableCell>
                <StyledTableCell align="right">Action</StyledTableCell>

            </TableRow>
            </TableHead>
            <TableBody>
            {rows.map(row => (
                <StyledTableRow key={row.name}>
                <StyledTableCell component="th" scope="row">
                    {row.name}
                </StyledTableCell>
                <StyledTableCell align="right">{row.sNo}</StyledTableCell>
                <StyledTableCell align="right">{row.photo}</StyledTableCell>
                <StyledTableCell align="right">{row.name}</StyledTableCell>
                <StyledTableCell align="right">{row.price}</StyledTableCell>
                <StyledTableCell align="right">{row.productId}</StyledTableCell>
                <StyledTableCell align="right">{row.status}</StyledTableCell>
                <StyledTableCell align="right">{row.action}</StyledTableCell>
                </StyledTableRow>
            ))}
            </TableBody>
        </Table>
        </Paper>
    );
}
